import React, {useEffect,useState} from 'react';
//import axios from 'axios';
import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import { makeStyles, styled, Modal, Button, TextField, MaterialTable } from '@material-ui/core';

import {Edit, Delete} from '@material-ui/icons';
import { Contenedor } from "../../Components";

export default function CampeonatosClub() {

    const columnas = [
        {
            title:'Nombre',
            field:'nombre'
        },
        {
            title: 'ID',
            field: 'id'
        },
        {
            title: 'Fecha Inicio',
            field: 'fi'
        },
        {
            title: 'Fecha Termino',
            field: 'ft'
        }
    ]

    return (
        <div>
            <Contenedor/>
            <div align = "center">
                <Box 
                    sx = {{flexGrow: 20}}
                    color = 'contrastText'
                    backgroundColor = '#D8F3DC'
                    mx = {20} //margen a todos los lados
                    p = {1} //padding
                    borderRadius = '8px'
                    border = {2}
                            
                >
                    <h1>Campeonatos</h1>
                </Box>
                <br></br>
                <Box
                    sx = {{flexGrow: 20}}
                    color = 'contrastText'
                    backgroundColor = '#D8F3DC'
                    mx = {20} //margen a todos los lados
                    //p = {30} //padding
                    borderRadius = '8px'
                    border = {2}
                >
                    <MaterialTable
                        columns = {columnas}
                    />
                </Box>

            </div>
        </div>
    )
}
